import "./Header.css";
// @ts-ignore
import Logo from "./../../Assets/logo.png";
// @ts-ignore
import SearchIcon from "./../../Assets/search-icon.png"

const Header = () => {
  return (
    <div className="HeaderWrapper">
      <img src={Logo} alt="Accent logo" className="HeaderLogo"/>
      <nav>
        <ul>
            <li>Home</li>
            <li>Shop</li>
            <li>About</li>
            <li>Blog</li>
            <li>Contact</li>
        </ul>
      </nav>
      <input type="text"></input>
    </div>
  );
};

export default Header;
